angular.module('managerApp').config(["$stateProvider", function ($stateProvider) {
  $stateProvider
  /**
       * EXISTING PROJECT
       * #/cloud/project/projectId
       */
  // View project by project id
  .state('iaas.pci-project', {
    url: '/pci/project/{projectId}',
    abstract: true,
    // [don't touch] empty url goes to cloud-project.cloud-project-details
    templateUrl: 'app/cloud/project/cloud-project.html',
    controller: 'CloudProjectCtrl',
    controllerAs: 'CloudProjectCtrl',
    translations: ['.'],
    resolve: {
      translations: ["$q", "$translate", "asyncLoader", function translations($q, $translate, asyncLoader) {
        var imports = [import("/Users/jleveugle/Documents/Work/github/ovh-ux/ovh-manager-cloud/client/app/cloud/project/translations/Messages_".concat($translate.use(), ".xml")).catch(function () {
          return import("/Users/jleveugle/Documents/Work/github/ovh-ux/ovh-manager-cloud/client/app/cloud/project/translations/Messages_".concat($translate.fallbackLanguage(), ".xml"));
        }).then(function (i) {
          return i.default;
        })];
        imports.forEach(function (p) {
          return asyncLoader.addTranslations(p);
        });
        return $q.all(imports).then(function () {
          return $translate.refresh();
        });
      }]
    },
    atInternet: {
      ignore: true
    }
  });
}]);
